import axios from "axios";

export function UserRegistration(regDto) {
  return axios.post("http://localhost:8080/register", regDto, {
    headers: {
      "Content-Type": "application/json;charset=utf-8"
    }
  });
}

export function userLogin(logindto){
  console.log(logindto);

  return axios.post("http://localhost:8080/login", logindto, {
    headers: {
      "Content-Type": "application/json;charset=utf-8"
    }
  });
}

export function forgotPassword(email){
    return axios.post("http://localhost:8080/forgotpassword",email,{
        headers: {
            "Content-Type": "application/json;charset=utf-8"
          }

    });
}

export function  setNewPassword(setpassworddto){
    return axios.post("http://localhost:8080/verfiy",setpassworddto,{
        headers: {
